INSERT INTO FUNCIONARIO_PERSONAL (cpfPersonal, telefone, diploma, planoContratacao) VALUES 
("05650090602", "44984151939", "Bacharelado em Educação Física", 
"Pelo presente instrumento particular de PRESTAÇÃO DE SERVIÇOS, Valquiria Fernandes dos Santos Palmeira, brasileira, residente e domiciliada em Campo Mourão, portadora do CPF 056.500.906-02, aqui denominada CONTRATADO, pactua o presente contrato de Prestação de Serviços em conformidade das cláusulas seguintes:
PRIMEIRA - Sendo o CONTRATADO, Bacharel ou Licenciado em Educação Física atuando na Área de PERSONAL TRAINING, o contrato tem por objetivo a prestação de serviços de treinamento para a academia, dentro das individualidades de cada cliente, resultado da avaliação física elaborada pelo CONTRATADO.
SEGUNDA - O prazo do presente CONTRATO é de no mínimo 03 (três) meses, iniciando-se a partir da assinatura do mesmo. Podendo ser renovado por igual período ou superior na quinzena que antecede o seu término.
TERCEIRA - Os programas de treinamento serão desenvolvidos nas dependências desta academia. As aulas serão ministradas com tempo mínimo de 60 (sessenta minutos) de forma individual para cada cliente.
QUARTA - O salário base do CONTRATADO será o valordois salários mínimos mínimo adotado no valor adotado pelo piso nacional, com reajustes da inflação anual, mais o percentual da quantidade de clientes atendidos mensalmente pelo CONTRATADO.
E por assim ter contratado, lavra e assina o presente instrumento em duas vias de igual teor e forma."), 
